import { Routes, Route } from "react-router-dom";

const DoblueRoutes = () => {
  return (
    <Routes>
      <Route path="care-service" element={<div>cs</div>} />
      <Route path="subscription" element={<div>s</div>} />
      <Route path="sell-trade" element={<div>st</div>} />
    </Routes>
  );
};

export default DoblueRoutes;
